(1, 'Memoria USB 32 GB', 2, 'Kingston', 'Azul', '30000.00', 20, 30, 'Memoria USB 2.0 marca Kingston de 32 GB de color azul.'),
(2, 'Xiaomi 10T Pro', 1, 'Xiaomi', 'Negro', '2500000.00', 10, 40, 'Celular Xiaomi 10T Pro de 256 GB de almacenamiento, con su cargador original y auriculares'),
(3, 'Audifonos HUAWEI FreeBuds 5i', 2, 'Huawei', 'Azul', '449900.00', 5, 30, 'Audifonos HUAWEI de 28 horas de duración de la báteria, resistentes al agua IP54, con conexión dual a dispositivos y cancelación Activa de Ruido Multimodal de 42 dB'),
(4, 'Oppo Reno 7', 1, 'Oppo', 'Azul', '2000000.00', 5, 10, 'OPPO Reno 7 cuenta con el procesador Snapdragon 680, un chipset 4G de ocho núcleos con tecnología de 6 nanómetros. Le acompañan 8 GB de RAM y 128 GB de almacenamiento interno. Como sistema operativo, trae ColorOs 12.1 basado en Android 12.'),
(5, ' Micro SD ADATA 8GB', 2, 'ADATA', 'Negro', '20000.00', 12, 20, 'Memoria micro SD ADATA de 8GB, con certificación FCC, CE, BSMI, VCCI y tipo de memoria interna UHS-I'),
(6, 'Cargador XIAOMI Carga Rápida 65W', 2, 'Xiaomi', 'Blanco', '140000.00', 4, 12, 'El Cargador de Pared Xiaomi 65W de gran potencia que puede llegar hasta alcanzar los 65W y con salida USB-C que te dará todo lo que necesitas para disfrutar de una carga rápida siendo la solución para minimizar los tiempos de carga en los smartphone.'),
(7, 'Carcasa Iphone 12', 2, 'Digicell', 'Rojo', '30000.00', 8, 16, 'Carcasa Iphone 12 /12 Pro Silicone Case de color rojo y con medidas de 14.68 cm de alto, 7.16 cm de ancho y 0.75 cm de profundidad.'),
(8, 'Cable usb 3.0 Samsung', 2, 'Samsung', 'Negro', '30000.00', 10, 20, 'Cable usb 3.0 Samsung negro con entrada USB salida USB Tipo C compatible con todas las marcas.'),
(9, 'Audífonos estéreo SONY', 2, 'SONY', 'Negro', '25000.00', 2, 13, 'Auriculares tipo almohadilla en llamativos colores, Respuesta de frecuencia de 18 - 22.000 Hz, Cable 1.2 m, tipo Y. Accesorios suministrados: Almohadillas.'),
(10, 'iPhone 12', 1, 'iPhone', 'Rojo', '3700000.00', 3, 7, 'El iPhone 12 cuenta con una pantalla Super Retina XDR de 6.1 pulgadas de tecnología OLED y está potenciado por el nuevo procesador A14 Bionic, con opciones de 64GB de almacenamiento interno. El sistema de cámaras trasero es dual.'),
(11, 'Adaptador de corriente USB-C de 20 W', 2, 'Apple', 'Blanco', '109000.00', 6, 14, 'El adaptador de corriente USB-C de 20 W de Apple es muy rápido y eficiente. Aunque es compatible con cualquier dispositivo con USB-C, Puedes usarlo con un iPhone 8 o posterior y aprovechar la carga rápida.'),
(12, 'Cable de conector Lightning a USB', 2, 'Apple', 'Blanco', '109000.00', 9, 15, 'El cable de conector Lightning a USB sirve para cargar y sincronizar el iPhone, iPad o iPod con un Mac o PC con Windows.'),
(13, 'Micro SD 16GB', 2, 'Sandisk', 'Gris', '26000.00', 10, 25, 'Memoria Micro Sd Sandisk Clase 10 de 16GB con velocidad de lectura de 80MB/s, Posee adaptador de memoria y USB.'),
(14, 'Audífonos Xiaomi Redmi Buds 3', 2, 'Xiaomi', 'Blanco', '189900.00', 2, 6, 'Los Redmi Buds 3 son los nuevos audífonos Bluetooth. Su diseño es \"semi in-ear\", según Xiaomi, y destacan por ser muy ligeros, pero equipados con el nuevo chip Qualcomm WCC3040 que les da conectividad Bluetooth 5.2, y resistencia al agua.'),
(15, 'Audífonos OPPO Enco Air2', 2, 'Oppo', 'Blanco', '50000.00', 5, 8, 'Audífonos Inalámbricos OPPO Enco Air 2 Bluetooth con cancelación de ruido Blanco y resistentes al agua.');
